import React from 'react';
import {
  Container,
  HeaderContainer,
  Header,
  SkipToContent,
  HeaderName,
  HeaderNavigation,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SideNav,
  SideNavItems,
  SideNavLink,
  SideNavMenu,
  SideNavMenuItem,
  SideNavRail,
  Breadcrumb,
  BreadcrumbItem,
  Button,
  Tabs,
  Tab,
} from 'carbon-components-react';

const props = {
  tabs: {
    selected: 0,
    role: 'navigation',
  },
  tab: {
    role: 'presentation',
    tabIndex: 0,
  },
};


const PzSidenavSet = (props) => {
  return (
  <div>

    <HeaderContainer 
      render={({ isSideNavExpanded, onClickSideNavExpand }) => (
        <SideNav
          className="pzsidenav-hedcont"
          aria-label="Side navigation"
          isRail
          expanded={isSideNavExpanded}
          onOverlayClick={onClickSideNavExpand}>
          <SideNavItems>
            <SideNavMenu> 
              renderIcon={props.icon} 
              title={props.title}
              href={props.link}
            </SideNavMenu>
          </SideNavItems>
        </SideNav>
        )
      }
    />
  </div>
  )
}

export default PzSidenavSet;
